VALUES(1, true, '2021-07-26 10:31:40.193', NULL, '16c54f6d-2409-48bb-bfbe-af6b62ce8851', NULL, 'RESUMO As iniciativas de educação corporativa vêm se institucionalizando como elemento de competitividade entre países (LANVIN; EVANS, 2013), organizações (EBOLI et al. 2010) e indivíduos (SARSUR, 2010', true, 'POLÍTICAS DE EDUCAÇÃO CORPORATIVA E O PROCESSO DE CERTIFICAÇÃO BANCÁRIA: DISTINTOS ATORES E PERSPECTIVAS');
VALUES(2, true, '2021-07-26 10:31:54.678', NULL, '04984d8f-dc0e-440f-82a2-2d8a40bf96ae', NULL, 'Este artigo aplica o modelo Panzar-Rosse para avaliar o nível de concorrência no setor bancário brasileiro. A amostra cobre 62 bancos no período de julho de 1994 a fevereiro de 2012. É dada especial atenção à presença de variáveis de escala na regressão, à existência de componentes sazonais nas séries temporais financeiras e à normaliz', true, 'COMPETIÇÃO BANCÁRIA NA ECONOMIA BRASILEIRA');
VALUES(3, true, '2021-07-26 10:57:06.364', NULL, '17855d44-618c-4f67-b685-7f0b1cb9206c', NULL, 'RESUMO As iniciativas de educação corporativa vêm se institucionalizando como elemento de competitividade entre países (LANVIN; EVANS, 2013), organizações (EBOLI et al. 2010) e indivíduos (SARSUR, 2010', true, 'POLÍTICAS DE EDUCAÇÃO CORPORATIVA E O PROCESSO DE CERTIFICAÇÃO BANCÁRIA: DISTINTOS ATORES E PERSPECTIVAS');
VALUES(4, true, '2021-07-26 12:49:38.545', NULL, '50b40316-f231-4ae4-9c5c-c68ab41e4074', NULL, 'Apesar dos diversos estudos que se desenvolveram nos últimos anos enfocando o crescimento dos chamados correspondentes bancários (CBs) como canal de distribuição de serviços financeiros à população de baixa renda no Brasil, existe uma importante lacuna nessa literatura, relacionada à compreensão das diferentes formas pelas quais redes de CBs podem', true, 'UM MAPEAMENTO DESCRITIVO DOS MODELOS DE GESTÃO DE REDES DE CORRESPONDENTES BANCÁRIOS NO BRASIL');
VALUES(5, true, '2021-07-26 12:49:43.863', NULL, 'c4df6471-d603-4d4d-9ae4-5729b6ac3480', NULL, 'RESUMO O artigo aborda o uso da informação para tomada de decisão em gestão de pessoas de gestores de agências bancárias. Os objetivos específicos são (i) identificar os canais e as fontes de informação utilizadas; (ii) identificar as principais barreiras enfrentadas; (iii) descrever os usos das informações do sistema de informação gerencial de', true, 'ANÁLISE DO USO DA INFORMAÇÃO PARA TOMADA DE DECISÃO GERENCIAL EM GESTÃO DE PESSOAS: ESTUDO DE CASO EM UMA INSTITUIÇÃO BANCÁRIA');
VALUES(7, true, '2021-07-26 12:50:01.094', '2021-07-26 16:03:59.129', '5b896825-cbb9-4c13-8bb5-43efbd8fd3e5', NULL, 'Este artigo aplica o modelo Panzar-Rosse para avaliar o nível de concorrência no setor bancário brasileiro. A amostra cobre 62 bancos no período de julho de 1994 a fevereiro de 2012. É dada especial atenção à presença de variáveis de escala na regressão, à existência de componentes sazonais nas séries temporais financeiras e à normaliz', false, 'COMPETIÇÃO BANCÁRIA NA ECONOMIA BRASILEIRA');
VALUES(6, true, '2021-07-26 12:49:54.828', '2021-07-26 16:06:41.988', 'f13f6279-b232-4cf8-ab08-edd653866eaa', NULL, 'Estimar a prevalência de casos sugestivos de LER/DORT e fatores associados três décadas após a reestruturação bancária. MÉTODOS: Estudo transversal com 356 funcionários de 27 agências bancárias das redes pública e privada de Porto Alegre, RS, entre abril e agosto de 2009. Foi utilizada análise estatística bruta e ajustada pelo modelo', false, 'LER/DORT NA TERCEIRA DÉCADA DA REESTRUTURAÇÃO BANCÁRIA: NOVOS FATORES ASSOCIADOS?');


